SELECT LOWER('s50') AS c0, RANK() OVER (ORDER BY t0.c6) AS c1 FROM t1 RIGHT JOIN t0 ON (1 = 0) LEFT JOIN v2 ON (1 = 0) LEFT JOIN v1 ON (1 = 0) JOIN v4 ON (1 = 0) RIGHT JOIN v3 ON (1 = 0) WHERE NOT EXISTS (SELECT v3.c1 AS c0 FROM v3 WHERE (v3.c0 <= 's36') ORDER BY v3.c1 DESC, v3.c1 DESC LIMIT 6) ORDER BY UPPER(v3.c0), v1.c1 LIMIT 3;
